DROP TABLE IF EXISTS `news`;
CREATE TABLE `news` (
  `news_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `news_title` varchar(255) DEFAULT NULL COMMENT '文章标题',
  `news_content` longtext COMMENT '文章内容',
  `cover_image` varchar(255) DEFAULT NULL COMMENT '文章封面',
  `creator_id` bigint(20) DEFAULT NULL,
