INSERT INTO `news` VALUES ('1', 'Java ArrayList forEach() 方法', '<h1>Java ArrayList forEach() 方法</h1><p><a href=\"https://www.runoob.com/java/java-arraylist.html\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(0, 102, 0);\"><img src=\"https://www.runoob.com/images/up.gif\" alt=\"Java ArrayList\">&nbsp;Java ArrayList</a></p><p>forEach() 方法用于遍历动态数组中每一个元素并执行特定操作。</p><p>forEach() 方法的语法为：</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">arraylist.forEach(Consumer&lt;E&gt; action)\n</pre><p><strong>注：</strong>arraylist 是 ArrayList 类的一个对象。</p><p><strong>参数说明：</strong></p><ul><li>action - 对每个元素执行的操作</li></ul><h3><strong>返回值</strong></h3><p>没有返回值。</p><h3><strong>实例</strong></h3><p>所有元素乘以 10：</p><h2>实例</h2><p><strong>import</strong>&nbsp;<span style=\"color: rgb(0, 102, 153);\">java.util.ArrayList</span><span style=\"color: rgb(51, 153, 51);\">;</span></p><p><br></p><p><strong>class</strong>&nbsp;Main&nbsp;<span style=\"color: rgb(0, 153, 0);\">{</span></p><p>&nbsp;&nbsp;&nbsp;<strong>public</strong>&nbsp;<strong>static</strong>&nbsp;<strong style=\"color: rgb(0, 0, 102);\">void</strong>&nbsp;main<span style=\"color: rgb(0, 153, 0);\">(</span><span style=\"color: rgb(0, 51, 153);\">String</span><span style=\"color: rgb(0, 153, 0);\">[]</span>&nbsp;args<span style=\"color: rgb(0, 153, 0);\">)</span>&nbsp;<span style=\"color: rgb(0, 153, 0);\">{</span></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<em style=\"color: rgb(102, 102, 102);\">// 创建一个数组</em></p><p>&nbsp;&nbsp;&nbsp;&nbsp;ArrayList<span style=\"color: rgb(51, 153, 51);\">&lt;</span>Integer<span style=\"color: rgb(51, 153, 51);\">&gt;</span>&nbsp;numbers&nbsp;<span style=\"color: rgb(51, 153, 51);\">=</span>&nbsp;<strong>new</strong>&nbsp;ArrayList<span style=\"color: rgb(51, 153, 51);\">&lt;&gt;</span><span style=\"color: rgb(0, 153, 0);\">()</span><span style=\"color: rgb(51, 153, 51);\">;</span></p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<em style=\"color: rgb(102, 102, 102);\">// 往数组中添加元素</em></p><p>&nbsp;&nbsp;&nbsp;&nbsp;numbers.<span style=\"color: rgb(0, 102, 51);\">add</span><span style=\"color: rgb(0, 153, 0);\">(</span><span style=\"color: rgb(204, 102, 204);\">1</span><span style=\"color: rgb(0, 153, 0);\">)</span><span style=\"color: rgb(51, 153, 51);\">;</span></p><p>&nbsp;&nbsp;&nbsp;&nbsp;numbers.<span style=\"color: rgb(0, 102, 51);\">add</span><span style=\"color: rgb(0, 153, 0);\">(</span><span style=\"color: rgb(204, 102, 204);\">2</span><span style=\"color: rgb(0, 153, 0);\">)</span><span style=\"color: rgb(51, 153, 51);\">;</span></p><p>&nbsp;&nbsp;&nbsp;&nbsp;numbers.<span style=\"color: rgb(0, 102, 51);\">add</span><span style=\"color: rgb(0, 153, 0);\">(</span><span style=\"color: rgb(204, 102, 204);\">3</span><span style=\"color: rgb(0, 153, 0);\">)</span><span style=\"color: rgb(51, 153, 51);\">;</span></p><p>&nbsp;&nbsp;&nbsp;&nbsp;numbers.<span style=\"color: rgb(0, 102, 51);\">add</span><span style=\"color: rgb(0, 153, 0);\">(</span><span style=\"color: rgb(204, 102, 204);\">4</span><span style=\"color: rgb(0, 153, 0);\">)</span><span style=\"color: rgb(51, 153, 51);\">;</span></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"color: rgb(0, 51, 153);\">System</span>.<span style=\"color: rgb(0, 102, 51);\">out</span>.<span style=\"color: rgb(0, 102, 51);\">println</span><span style=\"color: rgb(0, 153, 0);\">(</span><span style=\"color: rgb(0, 0, 255);\">\"ArrayList: \"</span>&nbsp;<span style=\"color: rgb(51, 153, 51);\">+</span>&nbsp;numbers<span style=\"color: rgb(0, 153, 0);\">)</span><span style=\"color: rgb(51, 153, 51);\">;</span></p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<em style=\"color: rgb(102, 102, 102);\">// 所有元素乘以 10</em></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"color: rgb(0, 51, 153);\">System</span>.<span style=\"color: rgb(0, 102, 51);\">out</span>.<span style=\"color: rgb(0, 102, 51);\">print</span><span style=\"color: rgb(0, 153, 0);\">(</span><span style=\"color: rgb(0, 0, 255);\">\"更新 ArrayList: \"</span><span style=\"color: rgb(0, 153, 0);\">)</span><span style=\"color: rgb(51, 153, 51);\">;</span></p><p>&nbsp;&nbsp;&nbsp;&nbsp;</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<em style=\"color: rgb(102, 102, 102);\">// 将 lambda 表达式传递给 forEach</em></p><p>&nbsp;&nbsp;&nbsp;&nbsp;numbers.<strong>forEach</strong><span style=\"color: rgb(0, 153, 0);\">((</span>e<span style=\"color: rgb(0, 153, 0);\">)</span>&nbsp;<span style=\"color: rgb(51, 153, 51);\">-&gt;</span>&nbsp;<span style=\"color: rgb(0, 153, 0);\">{</span></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;e&nbsp;<span style=\"color: rgb(51, 153, 51);\">=</span>&nbsp;e&nbsp;<span style=\"color: rgb(51, 153, 51);\">*</span>&nbsp;<span style=\"color: rgb(204, 102, 204);\">10</span><span style=\"color: rgb(51, 153, 51);\">;</span></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"color: rgb(0, 51, 153);\">System</span>.<span style=\"color: rgb(0, 102, 51);\">out</span>.<span style=\"color: rgb(0, 102, 51);\">print</span><span style=\"color: rgb(0, 153, 0);\">(</span>e&nbsp;<span style=\"color: rgb(51, 153, 51);\">+</span>&nbsp;<span style=\"color: rgb(0, 0, 255);\">\" \"</span><span style=\"color: rgb(0, 153, 0);\">)</span><span style=\"color: rgb(51, 153, 51);\">;</span></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"color: rgb(0, 153, 0);\">})</span><span style=\"color: rgb(51, 153, 51);\">;</span></p><p>&nbsp;&nbsp;&nbsp;<span style=\"color: rgb(0, 153, 0);\">}</span></p><p><span style=\"color: rgb(0, 153, 0);\">}</span></p><p>执行以上程序输出结果为：</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">ArrayList: [1, 2, 3, 4]\n更新 ArrayList: 10 20 30 40 \n</pre><p>在上面的实例中，我们创建了一个名为 numbers 的动态数组。</p><p>注意这一行：</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">numbers.forEach((e) -&gt; {\n    e = e * 10;\n    System.out.print(e + \" \");  \n});\n</pre><p>以上实例中，我们将匿名函数 lambda 的表达式作为 forEach() 方法的参数传入，lambda 表达式将动态数组中的每个元素乘以 10，然后输出结果。</p><p>有关 lambda 表达式的更多信息，请访问&nbsp;<a href=\"https://www.runoob.com/java/java8-lambda-expressions.html\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(0, 102, 0);\">Java Lambda</a>&nbsp;表达式。</p><p><strong>注意：</strong>forEach() 方法与 for-each 循环不同。<a href=\"https://www.runoob.com/java/java-loop.html#java-foreach\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(0, 102, 0);\">Java for-each</a>&nbsp;用于遍历数组中的每个元素。</p><p><img src=\"data:image/jpeg;base64,\"></p>', '/profile/upload/2021/11/30/bf009aac-6465-4f5c-9ea4-9d4105b0c0bf.jpg', null, '2021-11-30 18:01:17', '2021-12-01 16:54:43', '1');
