INSERT INTO `news` VALUES ('3', '防止他被人认出来！海南官方回应市民穿体彩工作服领4800万巨奖', '<p class=\"ql-align-justify\"><span style=\"color: rgb(96, 98, 102);\">&nbsp;据“海南省体彩”官方微信，11月29日晚，体彩大乐透第21137期开奖号码为 “02、07、13、14、19+04、05”。中得该期3注追加一等奖的中奖人王先生（化名）已于11月30日上午火速现身海南省体彩中心兑奖。因他采用追加倍投方式投注，单票奖金高达4834万元。</span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(96, 98, 102);\">&nbsp;&nbsp;&nbsp;&nbsp;该微信文章中称，80后的王先生自称去海南十多年了，是“新海南人”，购买大乐透十多年了，一个月买四五期。有房贷和外债压力的王先生表示一下子轻松了，他还主动捐出30万元给希望工程，用于资助困难家庭学子。</span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(96, 98, 102);\">&nbsp;&nbsp;&nbsp;&nbsp;这次金额不菲的颁奖事件，因为领奖者的衣服，受到更多关注。在领奖视频中，王先生穿着一件黑色外套，里面是一件白色T恤，T恤露出了“中国体育彩票”的LOGO和部分字样。一些网友于是质疑，领奖者难道是体彩内部员工？此次中奖事件是否真实？</span></p><p class=\"ql-align-center\"><span style=\"color: rgb(96, 98, 102);\"><img src=\"https://news.online.sh.cn/news/gb/content/attachement/jpg/site1/20211202/IMGb8ca3abea89358840611111.jpg\" alt=\"https://pic.rmb.bdstatic.com/bjh/down/efbb7a5d4d642d9a72c9e3d76d377c8e.jpeg\" height=\"900\" width=\"175\"></span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(96, 98, 102);\">&nbsp;&nbsp;&nbsp;&nbsp;12月1日下午，针对网友质疑，记者联系了海南省体育彩票管理中心。工作人员称，该男子来领奖是真实情况，在官网可以看到信息，他不是内部员工，而是普通的购彩者。因为中奖者的衣服特征明显，为了在采访时保护其隐私，建议其换上了体彩的衣服，中奖者也是自愿换上的。</span></p><p><br></p>', '/profile/upload/2021/12/02/1ebe25d8-c0f3-496d-935b-08e72338208e.jpg', '8', '2021-12-02 10:33:31', '2021-12-02 10:33:31', '0');
INSERT INTO `news` VALUES ('4', '《智能交通》正式出版发行 系国内首部全面阐述智能交通“中国模式”', '<p>原标题：《智能交通》正式出版发行 系国内首部全面阐述智能交通“中国模式”</p><p class=\"ql-align-center\"><img src=\"http://n.sinaimg.cn/spider20211202/134/w600h334/20211202/b204-cfa84a43c223eb65f94bb01d3480ffa2.jpg\"></p><p>新民晚报讯（记者 金志刚）12月2日，《智能交通：影响人类未来10—40年的重大变革》一书（以下简称“《智能交通》”）由人民出版社出版，即日起在全国新华书店发行。该书是在交通强国战略指引下，国内首部系统阐述中国智能交通发展现状和前景的专著，全书结合中国视角和国际视野，以立体化方式，全方位分析并阐述了智能交通建设的“中国模式”。</p><p>《智能交通》作者为百度创始人、董事长兼首席执行官李彦宏。全书共33万字，分为12章节，涵盖智能交通主要领域，包括智能交通运营商、智能信控、智慧停车、车路协同、智慧高速、智能汽车和自动驾驶、地图、MaaS出行即服务、智能交通与碳中和、人机混合时代等。该书不仅阐释了技术与交通行业融合应用，还分析了30个代表性城市案例，为交通智能化转型提供了现实参考和方向指引。</p><p>中国科学技术协会主席万钢、中国科学院院士白春礼、中国工程院院士潘云鹤作序。万钢表示，本书总结了自动驾驶、智慧交通领域的创新、探索和实践，呼应了“交通强国”时代议题。白春礼指出，《智能交通》思考交通与经济社会辩证关系、梳理交通智能化发展脉络、展望交通运营管理甚至人机关系未来形态，实证丰富、可读性颇高。潘云鹤提到，智能交通是一个兼具深度和广度的智能大系统，书中相关创新研究和实践，一定能推动和引领国内外智能交通的新发展。中国工程院外籍院士张亚勤评价，深度学习和智能<a href=\"https://finance.sina.com.cn/realstock/company/sz300024/nc.shtml\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(55, 83, 162);\">机器人</a>(10.220,&nbsp;-0.16,&nbsp;-1.54%)正在重构未来的汽车、交通和城市，《智能交通》以崭新观点和战略思维给智能交通的科学家、产业领袖及政策制定者都带来新的启示和灵感。</p><p>李彦宏表示，我国有着领先的科技人才红利，有着丰富的人工智能应用场景，有着无可比拟的良好政策环境，中国智能交通建设必将走在世界前列。本书既是对百度8年多来深耕智能交通领域积累的总结，更是对中国智能交通未来发展宏图的展望。</p><p>该书首次系统性地提出中国智能交通领域六大创新理念和模式，即智能交通运营商模式、车路协同自动驾驶、自适应的智能信控系统、L4级以上高级别自动驾驶的技术难点与突破、MaaS出行即服务模式、地图ETA通行时间智能预估和预约出行。</p><p>该书还科学地描绘了智能交通未来：由新技术、新理念、新模式构建的智能交通系统，有望降低90%交通安全事故；5年之内，中国一线城市将不再需要“限购”和“限行”；10年之内，依托交通效率提升，城市拥堵问题将基本解决；随着共享无人车的普及，私家车的需求量将大幅降低。</p>', '/profile/upload/2021/12/02/1c7f20d5-c00d-49db-9b6f-6d369109b61d.jpg', '8', '2021-12-02 15:05:29', '2021-12-02 15:05:29', '0');
INSERT INTO `news` VALUES ('5', '满洲里本轮疫情为何发展如此迅速？专家解答', '<p>	<span style=\"color: rgb(3, 3, 3);\">每经AI快讯，近期，内蒙古满洲里连续报告大量本土新冠肺炎确诊病例。专家介绍，此次疫情系新的境外输入源头引起，其传播速度快、范围广。感染病例被发现时，疫情已发生扩散。“快速增长”是因为此前病例已有了一定“存量”，目前是将这些“存量”都“挖出来”。（央视新闻）</span></p>', '/profile/upload/2021/12/02/dbda3c99-b498-4e68-8b56-fdfadf0efdb7.png', '8', '2021-12-02 15:07:40', '2021-12-02 15:07:40', '0');
INSERT INTO `news` VALUES ('6', '西安外国语大学通报学生在女厕偷拍：留校察看处分', '<p><img src=\"data:image/jpeg;base64,\"></p><p>西安外国语大学官微消息，11月18日，我校学生李某某在女厕所偷拍被当场抓获。学校对此高度重视，并配合公安机关立即依规开展调查取证。29日，学校依据学生违纪处分办法，给予李某某留校察看处分。</p><p>近日，此事引起部分学生及网络舆论关注，学校真诚感谢各方提出的宝贵意见。今后将及时公开信息，回应师生关切，全面排查整治校园安全隐患，坚决维护师生安全和校园稳定。</p>', '/profile/upload/2021/12/02/361687cd-2ca4-4a9e-9bc8-16381ebe6fac.jpeg', '8', '2021-12-02 15:09:14', '2021-12-02 15:09:14', '0');
INSERT INTO `news` VALUES ('7', '“20211202”，正着读反着读都一样', '<p><span style=\"color: rgb(51, 51, 51);\">【今天，有点特别！</span><a href=\"https://s.weibo.com/weibo?q=%2320211202%E5%AE%8C%E5%85%A8%E5%AF%B9%E7%A7%B0%E6%97%A5%23\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(235, 115, 64);\">#20211202完全对称日#</a><span style=\"color: rgb(51, 51, 51);\">】“20211202”，正着读反着读都一样。分享视频↓感受</span><a href=\"https://s.weibo.com/weibo?q=%23%E4%B8%AD%E5%9B%BD%E5%BB%BA%E7%AD%91%E5%AF%B9%E7%A7%B0%E4%B9%8B%E7%BE%8E%23\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(235, 115, 64);\">#中国建筑对称之美#</a><span style=\"color: rgb(51, 51, 51);\"><img src=\"https://face.t.sinajs.cn/t4/appstyle/expression/ext/normal/8a/2018new_xin_org.png\" alt=\"[心]\">对称日，愿你称心如意！</span><a href=\"http://t.cn/A6x9rEq9\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(235, 115, 64);\"><img src=\"https://h5.sinaimg.cn/upload/2015/09/25/3/timeline_card_small_video_default.png\">央视新闻的微博视频</a><span style=\"color: rgb(51, 51, 51);\">&nbsp;​​​﻿</span></p><p><br></p><iframe class=\"ql-video\" frameborder=\"0\" allowfullscreen=\"true\" src=\"https://wx4.sinaimg.cn/f.video.weibocdn.com/o0/w6pmR1qMlx07RQfMGlUs01041201cb4v0E010.mp4?label=mp4_1080p&amp;template=1080x1870.null&amp;trans_finger=29b4e2632eecf57041482ba4ad6c4dce&amp;media_id=4709882994294847&amp;tp=8x8A3El:7fHprYw&amp;us=0&amp;ori=1&amp;bf=4&amp;ot=v&amp;lp=000014wmwM&amp;ps=mZ6WB&amp;uid=6d6t6G&amp;ab=3915-g1,1192-g0,1258-g0,3601-g15&amp;Expires=1638432656&amp;ssig=Vsp2WBuYWn&amp;KID=unistore,video\"></iframe><p><a href=\"https://www.yinlinkrc.com/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(51, 51, 51);\">﻿银领人才网</a></p><p><a href=\"http://localhost:8989/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(51, 51, 51);\">官网</a></p>', '/profile/upload/2021/12/02/4df03c0c-c528-4339-bc67-bc315ff19fb9.jpg', '8', '2021-12-02 15:19:33', '2021-12-02 17:06:30', '0');
INSERT INTO `news` VALUES ('8', '电子驾驶证12月10日起全国全面推行', '<p>新华社北京12月2日电（记者任沁沁、熊丰）记者2日从公安部获悉，自12月10日起，电子驾驶证将在全国全面推行，提供在线“亮证”服务。</p><p><br></p><p>此前，驾驶证电子化已覆盖北京、上海、广州、西安等200个城市，5000多万名驾驶人领取了电子驾驶证。在前期试点和分批推广应用基础上，公安部部署全国全面推广应用电子驾驶证。</p><p>电子驾驶证通过全国统一的“交管12123”App发放，与纸质驾驶证同等效力，在全国范围内有效；可以在办理交管业务、接受执法检查时出示使用，并可以拓展客货运输、汽车租赁、保险购置等社会应用场景。</p><p>此外，按照统一部署，二手车异地交易登记、“交管12123”App核发货车电子通行码、交通事故证据材料网上查阅等公安交管便利措施也将同步在全国推行，更好便利群众办事出行，更好服务企业行业发展。（完）</p><p><br></p>', '/profile/upload/2021/12/02/91b2e5bb-46f3-498a-8c93-00679a6dad5a.jpg', '8', '2021-12-02 22:36:38', '2021-12-02 22:36:38', '0');

