-- ----------------------------
-- Table structure for sys_notice
-- ----------------------------
DROP TABLE IF EXISTS `sys_notice`;
CREATE TABLE `sys_notice` (
  `notice_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '公告ID',
  `notice_title` varchar(50) NOT NULL COMMENT '公告标题',
  `notice_type` char(1) NOT NULL DEFAULT '1' COMMENT '公告类型（1通知 2公告）',
  `notice_content` longtext COMMENT '公告内容',
  `status` char(1) DEFAULT '0' COMMENT '公告状态（0正常 1关闭）',
  `creator_id` bigint(20) DEFAULT NULL COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_id` bigint(20) DEFAULT NULL COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `is_deleted` tinyint(2) DEFAULT '0' COMMENT '是否删除',
  PRIMARY KEY (`notice_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='通知公告表';

-- ----------------------------
-- Records of sys_notice
-- ----------------------------
INSERT INTO `sys_notice` VALUES ('1', '上海银领网络科技有限公司上市', '1', '<h2><span style=\"color: rgb(44, 62, 80);\"><img src=\"https://www.yinlinkrc.com/img/zz.486fbffd.png\"></span>	</h2><h2>上海银领网络科技有限公司</h2><p>上海银领网络科技有限公司致力于开发“银领人才”（现代高技能人才）招聘的专业网站。在5G时代到来之际，银领人才网依托互联网PC+移动端以及AI人工智能和大数据打造全新的，属于5G时代的专业招聘网站，为“既动手又动脑”的银领人才求职提供多维度、精准化的招聘服务，为中国智能制造、制造业强国提供高技能人才的支撑。</p><p>我们坚持以技术为先导、以人力资源服务为载体、以三方共赢为目的的指导方针，为企业引进专业技术人才，力争在招聘服务行业开创全方位技术人才培养、招聘服务的新篇章、为国家技术工匠的招聘与储备提供便利条件。强化服务意识，提供一流的、最完善的服务。</p><p>我们拥有人性化、制度化、规范化、流程化、标准化的先进管理。</p><p>我们拥有众多素质高、技术好、业务强的人才和员工队伍。</p><p>我们拥有自主品牌的产品和自主产品的研发队伍。</p><p>我们有让银领人才真正实现“一技在手、工作我有。”的坚定目标！</p>', '0', '8', '2021-12-02 11:22:40', null, '2021-12-02 22:33:11', '0');
INSERT INTO `sys_notice` VALUES ('3', '开发完成', '1', '<p>撒大苏打撒阿三大苏打<a href=\"强强我去饿我去\" rel=\"noopener noreferrer\" target=\"_blank\">撒旦</a><img src=\"data:image/jpeg;base64,\"></p>', '0', '8', '2021-12-02 22:35:38', null, null, '0');

-- ----------------------------
-- Table structure for user
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `username` varchar(255) DEFAULT NULL COMMENT '用户昵称',
  `password` varchar(255) NOT NULL COMMENT '密码',
  `email` varchar(50) NOT NULL COMMENT '邮箱',
  `role` varchar(255) DEFAULT NULL COMMENT '角色',
  `avatar_image` varchar(500) DEFAULT '/profile/upload/2021/10/28/088d4925-7411-4447-90d8-3239eaee68f2.gif' COMMENT '头像',
  `creator_id` bigint(20) DEFAULT '0',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `age` int(11) DEFAULT '18' COMMENT '年龄',
  `sex` varchar(10) DEFAULT '男' COMMENT '性别',
  `clock_frequency` int(11) DEFAULT '0' COMMENT '总打卡次数',
  `status` varchar(20) DEFAULT 'valid' COMMENT '状态 ''UNKNOWN'': 未知 ''valid''：有效，''invalid''：无效',
  `user_type` int(11) DEFAULT '0' COMMENT '0:C端，1：后台',
  `qr_uuid` varchar(500) DEFAULT NULL COMMENT '二维码的uuid',
  `qr_id` bigint(20) DEFAULT NULL COMMENT '二维码主键id',
  `is_deleted` tinyint(2) DEFAULT '0' COMMENT '是否删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

